  type: Class
  package: com.azure.cosmos.implementation.guava25.collect
  summary: >-
    A skeleton implementation of a descending multiset view. Normally, <xref uid="" data-throw-if-not-resolved="false">#descendingMultiset()</xref> will not reflect any changes you make to the behavior of methods such as <xref uid="" data-throw-if-not-resolved="false">#add(Object)</xref> or <xref uid="" data-throw-if-not-resolved="false">#pollFirstEntry</xref>. This skeleton implementation correctly delegates each of its operations to the appropriate methods of this `ForwardingSortedMultiset`.


    In many cases, you may wish to override <xref uid="" data-throw-if-not-resolved="false">#descendingMultiset()</xref> to return an instance of a subclass of `StandardDescendingMultiset`.
